Object.is = function (x, y) {
  // \u5982\u679Cx\u548Cy\u90FD\u662FNaN
  if (x !== x && y !== y) {
    return true;
  }
  // \u68C0\u67E5-0\u548C+0
  if (x === 0 && y === 0) {
    return 1 / x === 1 / y;
  }
  // \u5176\u4ED6\u60C5\u51B5\u4F7F\u7528\u4E25\u683C\u6BD4\u8F83
  return x === y;
};
