  // \u521B\u5EFA\u4E00\u4E2A\u65B0\u7684\u7A7A\u5BF9\u8C61
  let obj = {};
  // \u5C06\u8FD9\u4E2A\u7A7A\u5BF9\u8C61\u7684__proto__\u6307\u5411\u6784\u9020\u51FD\u6570\u7684\u539F\u578B
  // obj.__proto__ = Con.prototype;
