const app = new Koa();
app.use(async (ctx, next) => {
  console.log('---1--->');
  await next();
  console.log('===6===>');
});
app.use(async (ctx, next) => {
  console.log('---2--->');
  await next();
  console.log('===5===>');
});
app.use(async (ctx, next) => {
  console.log('---3--->');
  await next();
  console.log('===4===>');
});

app.listen(8899, () => {
  console.log('\u5E94\u7528\u542F\u52A8\u4E86');
});

// \u6267\u884C\u7ED3\u6784\u7ED3\u679C\u5C31\u662F 1 2 3 4 5 6

let fn = function (ctx) {
  return dispatch(0);

  function dispatch(i) {
    let currentMW = middleware[i];
    if (!currentMW) {
      return;
    }
    return currentMW(ctx, dispatch.bind(null, i + 1));
  }
};

fn();
