  let resolved = false;
  let t = 1;
  return new Promise((resolve, reject) => {
    // Promise.race([
    //     fetch(url),
    //     wait(100, () => fetch(url)),
    //     wait(200, () => fetch(url)),
    //     wait(400, () => fetch(url)),
    //     wait(800, () => fetch(url)),
    //     wait(1600, () => fetch(url)),
    // ])
    function doFetch() {
      if (resolved || t > 16) return;
      fetch(url)
        .then((resp) => resp.text())
        .then((data) => {
          if (!resolved) {
            resolved = true;
            resolve(data);
          }
        });

      setTimeout(() => {
        doFetch();
        t *= 2;
      }, t * 100);
    }
    doFetch();
  });
